import './App.css';
import {BrowserRouter as Router,Routes,Route} from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route index element={<h1>hello world2</h1>}></Route>
          <Route path='/movies' element={<h1>all movies displayed here</h1>}></Route>
          <Route path='/top-rated' element={<h1>all top-rated movies displayed here</h1>}></Route>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
